import React, { Component } from 'react';
import styled from 'styled-components'
import Navbar from '../Navbar'
import Home from '../Home'


const BG = styled.div`

  background : #222;
  color: #fb9fa4;

`

class App extends Component {
  render() {
    return (
      <BG><div>
          <Home/>
          </div>
      </BG>
        );
      }
    }
export default App
